import React from 'react'
import styled from "@emotion/styled";

const Container = styled.div`
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
    width: 40%;
`

const Card = styled.div`
    padding: 20px;
`

const Result = ({ list }) => {

    const emojis = list && list.map( emoji => {
        if (emoji) {
            return (
                <Card>
                    {emoji.symbol}
                </Card>
            );
        }
        return null;
    });

    return (
        <Container>
            {emojis}
        </Container>
    );
}

export default Result;
